import { Link } from "react-router-dom";
import { useState, useEffect } from "react";
import api from "../api/axios";

function Navbar({ scrolled }) {
  const [query, setQuery] = useState("");
  const [suggestions, setSuggestions] = useState([]);

  useEffect(() => {
    const fetchSuggestions = async () => {
      if (query.trim().length < 2) return setSuggestions([]);
      try {
        const res = await api.get("/medicines/search", {
          params: { q: query },
        });
        setSuggestions(res.data);
      } catch (err) {
        console.error("Search error:", err.message);
      }
    };

    const debounce = setTimeout(fetchSuggestions, 300);
    return () => clearTimeout(debounce);
  }, [query]);

  return (
    <>
      {/* ✅ Fixed Navbar */}
      <nav className="navbar navbar-expand-lg navbar-light bg-light shadow-sm fixed-top">
        <div className="container-fluid d-flex align-items-center justify-content-between">
          {/* Left: Logo + Search bar */}
          <div className="d-flex align-items-center flex-grow-1">
            <Link className="navbar-brand d-flex align-items-center me-3" to="/">
              <img
                src="/images/logo.png"
                alt="Logo"
                width="45"
                height="45"
                className="me-2"
              />
              <span className="fw-bold text-primary">
                Medi<span className="text-dark">Q</span>
              </span>
            </Link>

            {/* Search bar visible only when scrolled */}
            {scrolled && (
              <div className="search-bar-container compact">
                <input
                  type="text"
                  className="form-control me-2"
                  placeholder="Search by name, symptom, or category"
                  value={query}
                  onChange={(e) => setQuery(e.target.value)}
                />
                <button type="submit" className="btn btn-primary">
                  Search
                </button>
              </div>
            )}
          </div>

          {/* Right: Navigation links */}
          <div className="collapse navbar-collapse justify-content-end" id="navbarNav">
            <ul className="navbar-nav align-items-center">
              <li className="nav-item">
                <Link className="nav-link" to="/">🏠 Home</Link>
              </li>
              <li className="nav-item">
                <Link className="nav-link" to="/medicines">💊 Shop</Link>
              </li>
              <li className="nav-item">
                <Link className="nav-link" to="/upload">📤 Upload</Link>
              </li>
              <li className="nav-item">
                <Link className="nav-link" to="/cart">🛒 Cart</Link>
              </li>
              <li className="nav-item">
                <Link className="btn btn-outline-primary ms-lg-3 mt-2 mt-lg-0 px-3" to="/login">
                  🔑 Sign In / Join
                </Link>
              </li>
            </ul>
          </div>
        </div>
      </nav>

      {/* ✅ Search Results BELOW Navbar */}
      {scrolled && suggestions.length > 0 && (
        <div
          className="container"
          style={{
            marginTop: "80px",
            padding: "20px",
            background: "#fff",
            borderRadius: "12px",
            boxShadow: "0 4px 12px rgba(0,0,0,0.08)",
          }}
        >
          <h5 className="mb-3 text-primary">
            Showing results for: <span className="text-dark">{query}</span>
          </h5>

          <div className="row">
            {suggestions.map((med) => (
              <div key={med._id} className="col-md-4 mb-4">
                <div className="p-3 border rounded shadow-sm h-100 bg-light">
                  <h6 className="text-primary">{med.name}</h6>
                  <p className="mb-1"><strong>Category:</strong> {med.category}</p>
                  <p className="mb-1"><strong>Symptoms:</strong> {med.symptoms.join(", ")}</p>
                  <p className="mb-1 text-muted" style={{ fontSize: "14px" }}>{med.description}</p>
                  <p className="mt-2"><strong>Price:</strong> ₹{med.price}</p>
                </div>
              </div>
            ))}
          </div>
        </div>
      )}
    </>
  );
}

export default Navbar;
